import React from "react";
import styles from "./CarItem.module.css";

const CarItem = (props) => {
  const addToFavsHandler = (e) => {
    e.preventDefault();
    console.log(props.Model_Name);
  };
  return (
    <div className={styles["car-item"]}>
      <div className={styles["add-to-favs-btn"]}>
        <button onClick={addToFavsHandler}>Add to favs</button>
      </div>
      <div className={styles["car-model"]}>{props.Model_Name}</div>
      <div className={styles["car-info"]}>
        <span className={styles["car-name"]}>{props.Make_Name} </span>
        <span className={styles["car-id"]}>{props.Model_ID}</span>
      </div>
    </div>
  );
};
export default CarItem;
